<template>
  <div class="wrap">
    <div v-bind:class="musicName" @touchstart="pausedMusic">
        <audio id="musicId" loop="loop" autoplay="autoplay">
         <source src="data:application/octet-stream;base64,"
 type="audio/mpeg">
        </audio>
    </div>
    <router-view></router-view>
  </div>
</template>

<script>
    'use strict';
    import router from '../route/route.js';
    import client from '../../../common/client.interactive.js';

    export default {
        created() {
            //设置app按钮分享
            let shareData = {
                type:1,
                title: '2017贫穷限制了你多少想象力考卷',
                detail: '是时候展示真正的财力了',
                url: location.href + '?v=' + new Date().getTime(),
                img: 'http://images.9zhitx.com/post/20171109/8d0a957d-27a0-4eb9-b2e4-edff688c5c2b4201.png',
                nativeShareBtn: 1
            }
            client.clientShareOut(shareData);
        },
        data() {
            return {
                musicName:"music music-play",
                playnum:-1
            }
        },
        methods: {
            pausedMusic(){
                if(this.playnum == -1){
                    document.getElementById('musicId').pause();
                    this.playnum = 1;
                    this.musicName="music music-pause";
                }else {
                    document.getElementById('musicId').play();
                    this.playnum = -1;
                    this.musicName="music music-play";
                } 
            }
        },
        router
    }

</script>

<style>
     @keyframes rotate
    {
        0% {
            transform: rotate(0deg);
            -webkit-transform: rotate(0deg);   /* Safari and Chrome */
        }
        100% {
             transform: rotate(360deg);
            -webkit-transform: rotate(360deg);   /* Safari and Chrome */
        }
    }

    @-moz-keyframes rotate /* Firefox */
    {
        0% {
            transform: rotate(0deg);
