    }
    .wrap{
        width:100%;
        height:100%
    }
    .music {
        position: absolute;
        right: 1rem;
        top: 1rem;
        width: 2.36rem;
        height: 2.36rem;
        background: url('../libs/music.png') no-repeat left top;
        background-size: 2.36rem 2.36rem;
        z-index: 10;
    }
    .music-play {
        animation: rotate 5s linear infinite;
        -webkit-animation: rotate 5s linear infinite;
    }
    .music-pause {
        animation-play-state: paused;
       -webkit-animation-play-state: paused;
